import React, { Component } from 'react';

class Header extends Component {

  render() {
    return (
      <footer>
        <div className="container-footer">
          <div className="content-footer">
            Created with love by Mutia Ayu Dianita April 3th 2021
          </div>
        </div>
      </footer>
    );
  }
}

export default Header;
